    "content": "{\"name\":\"Homo sapiens (Human)\",\"description\":\"Homo sapiens (Homo sapiens sapiens) or modern humans are the only living species of the evolutionary branch of great apes known as hominids. Divergence of early humans from chimpanzees and gorillas is estimated to have occurred between 4 and 8 million years ago. The genus Homo (Homo habilis) appeared in Africa around 2.3 million years ago and shows the first signs of stone tool usage. The exact lineage of Homo species ie: H. habilis/H. ergaster to H. erectus to H. rhodesiensis/H.heidelbergensis to H. sapiens is still hotly disputed. However, continuing evolution and in particular larger brain size and complexity culminates in Homo sapiens. The first anatomically modern humans appear in the fossil record around 200,000 years ago. Modern humans migrated across the globe essentially as hunter-gatherers until around 12,000 years ago when the practice of agriculture and animal domestication enabled large populations to grow leading to the development of civilizations.\",\"isReferenceProteome\":true,\"isRepresentativeProteome\":true,\"genomeAssembly\":{\"genomeAssemblySource\":\"Ensembl\",\"genomeAssembly\":\"GCA_000001405.29\",\"genomeAssemblyUrl\":\"http://www.ensembl.org/Homo_sapiens/Info/Annotation\",\"genomeRepresentation\":\"full\"},\"dbReference\":[{\"type\":\"GCSetAcc\",\"id\":\"GCA_000001405.29\"},{\"type\":\"AssemblyId\",\"id\":\"GRCh38.p14\"}],\"component\":[{\"description\":\"Homo sapiens chromosome 1, GRCh38 reference primary assembly.\",\"genomeAccession\":[\"CM000663\"],\"name\":\"Chromosome 1\",\"count\":0},{\"description\":\"Homo sapiens chromosome 2, GRCh38 reference primary assembly.\",\"genomeAccession\":[\"CM000664\"],\"name\":\"Chromosome 2\",\"count\":0},{\"description\":\"Homo sapiens chromosome 2 unlocalized genomic contig, GRCh38 reference primary assembly.\",\"genomeAccession\":[\"KI270715\"],\"name\":\"Chromosome 2\",\"count\":0},{\"description\":\"Homo sapiens chromosome 2 un